import { useState } from 'react';

const Navbar = () => {
    const [isOpen, setIsOpen] = useState(false);

    const toggleMenu = () => {
        setIsOpen(!isOpen);
    };

    return (
        <nav className="bg-white shadow-lg">
            <div className="container mx-auto px-6 py-3 flex justify-between items-center">
                {/* Logo */}
                <div className="text-2xl font-bold text-gray-800">
                    <a href="/">BrandName</a>
                </div>

                {/* Links */}
                <div className={`md:flex space-x-4 ${isOpen ? 'block' : 'hidden'}`}>
                    <a href="#home" className="text-gray-800 hover:text-gray-600 block md:inline">
                        Home
                    </a>
                    <a href="#process" className="text-gray-800 hover:text-gray-600 block md:inline">
                        How It Works
                    </a>
                    <a href="#features" className="text-gray-800 hover:text-gray-600 block md:inline">
                        Features
                    </a>
                    <a href="#feedback" className="text-gray-800 hover:text-gray-600 block md:inline">
                        Feedback
                    </a>
                    <a href="#about" className="text-gray-800 hover:text-gray-600 block md:inline">
                        About Us
                    </a>
                    <a href="#contact" className="text-gray-800 hover:text-gray-600 block md:inline">
                        Contact
                    </a>
                    <button className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-400 block md:inline">
                        Login
                    </button>
                </div>

                {/* Mobile Menu Button */}
                <div className="md:hidden flex items-center">
                    <button onClick={toggleMenu} className="text-gray-800 focus:outline-none">
                        <svg className="h-6 w-6" fill="none" strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" viewBox="0 0 24 24" stroke="currentColor">
                            <path d="M4 6h16M4 12h16M4 18h16"></path>
                        </svg>
                    </button>
                </div>
            </div>
        </nav>
    );
};

export default Navbar;
